import React from "react";
import "./App.css";
import Login from "./Login";
import Fignup from "./Fignup"
// import  {BrowserRouter as Router,Switch,Route} from "react-router-dom"
import { BrowserRouter, Routes, Route } from 'react-router-dom';



function App() {


  return (

   <BrowserRouter>
    <div>

      <Routes>
      <Route path="/Login" component={Login} />
      <Route path="/Fignup" component={Fignup}/>
      </Routes>
      </div>
      </BrowserRouter>
  )
}

const Home = ()=>{

return(

<div>


<h1>hello every one to home </h1>


</div>



)


}
export default App;
